import logo from './logo.svg';
import './App.css';

function App() {
  const logo = "https://www.google.com/imgres?imgurl=https%3A%2F%2Fd150u0abw3r906.cloudfront.net%2Fwp-content%2Fuploads%2F2021%2F10%2Fimage2-2-1024x649.png&tbnid=52oMVvE-SAVTBM&vet=12ahUKEwjqm_G53oOAAxWUrGMGHXQjAXEQMygWegUIARCRAg..i&imgrefurl=https%3A%2F%2Fwww.nfi.edu%2Flandscape-photography%2F&docid=JRiHSk01Ix3NeM&w=1024&h=649&q=landscape&ved=2ahUKEwjqm_G53oOAAxWUrGMGHXQjAXEQMygWegUIARCRAg";
  return (
   <div>
    <img src={logo} alt="banner" />
    <div></div>
   </div>
  );
}

export default App;
